        <div class="white ml10 row-between" style="flex: 1">
          <div>
            <div style="font-size: 28px">{{integral}}</div>
            <div class="row">
              <div class="sm row" hover-class="none" @click="toPage('signRule')">
                我的积分
                <img
                  src="@A/images/jifen_icon_help.png"
                  class="ml5"
                  style="width: 0.4rem;height: 0.4rem"
                />
              </div>
            </div>
          </div>
          <div class="score-detail-entry row">
            <img
              style="width: 13px;height: 13px;flex: none; margin-right: 3px"
              src="@A/images/jifen_icon_data.png"
            />
            <div class="sm white" @click="toPage('signDetail')">积分明细</div>
          </div>
        </div>
      </div>
    </div>
    <div class="main">
      <div class="contain bg-white">
        <div class="title">已累计签到 {{signDays}}天</div>
        <div class="day-list row wrap">
          <div class="item column-center" v-for="(item, index) in signList" :key="index">
            <div class="num xs" v-if="item.status != 1">+{{item.integral}}</div>
            <img
              class="num"
              src="@A/images/jifen_icon_select.png"
              v-if="item.status == 1"
            />
            <div class="day mt5 lighter xxs">{{item.days}}天</div>
          </div>
        </div>
        <div class="right-sgin">
          <button
            @click="$userSign"
            class="white br60"
            :class="canSign == 1 ? 'gray' : 'primary-button'"
          >{{canSign == 1 ? '已签到' : '立即签到' }}</button>
        </div>
      </div>
      <div class="contain bg-white mt10">
        <div class="title row">
          <div class="line br60 mr10"></div>
          <div class="bold xl">赚积分</div>
        </div>
        <div class="task">
          <div class="item row" v-for="(item, index) in makeInegral" :key="index">
            <img class="img mr10" :src="item.type == 1 ? require('@A/images/icon_jifen_qiandao.png') : item.type == 2 ? require('@A/images/icon_jifen_pay.png') : require('@A/images/icon_jifen_invite.png')" />
            <div class="con">
              <div class="md">{{item.name}}</div>
              <div class="xs row mb10">
                <div class="num">+{{item.integral}}</div>
                <div>积分</div>
              </div>
            </div>
            <button class="btn br60" :class="{'muted': !item.status, 'primary': item.status}" :style="{'border-color': item.status ? '#F95F2F' : '#999999'}" size="xs">{{item.status ? '已完成' : '未完成'}}</button>
          </div>
        </div>
      </div>
    </div>
    <van-popup v-model="showPop" transition="fade">
      <div class="pop-container">
        <div class="header-score row-center mt10">+{{addIntegral}}</div>
        <div class="box column-center">
          <div class="desc row mt10 sm">
            <img
              style="width: 14px; height: 15px;margin-right: 4px"
              src="@A/images/icon_jifen.png"
            />
            {{addIntegral}}积分 + {{addGrowth}}成长值
          </div>
          <div class="bottom-box">
            <div class="md" style="line-height: 18px">
              您已连续签到 <span class="primary" style="font-size: 21px">{{signDays}}</span> 天
            </div>
          </div>
          <button
            @click="closePop"
            class="bg-primary white br60 primary-btn"
            style="margin-top: 13px"
          >确定</button>
        </div>
      </div>
    </van-popup>
  </div>
</template>

<script>
import { getSignList, userSign, getSignRule } from "@API/app";
import { getUser } from "@/api/user";
export default {
  name: "userSign",
  data() {
    return {
      userInfo: {},
      // 成长值
      growth: 0,
      // 积分
      integral: 0,
      avator: "",
      signList: [],
      showPop: false,
      canSign: 0,

      addIntegral: 0,
      addGrowth: 0,
      signDays: 0,
      makeInegral: []
    };
  },
  methods: {
    $getSignList() {
      getSignList().then((res) => {
        if (res.code == 1) {
          this.signList = res.data.sign_list;
          this.integral = res.data.user.user_integral;
          this.canSign = res.data.user.today_sign;
          this.signDays = res.data.user.days;
          this.makeInegral = res.data.make_inegral
        }
      });
    },
    closePop(e) {
      this.showPop = false;
    },
    $getUser() {
      getUser().then((res) => {
          if (res.code == 1) {
              this.userInfo = res.data;
          }
      });
    },
    $userSign() {
      if (this.canSign == 1) {
        return;
      }
      userSign().then((res) => {
        if (res.code == 1) {
          let { days, growth, integral } = res.data;
          this.showPop = true;
          this.addGrowth = growth;
          this.addIntegral = integral;
          this.signDays = days;
          this.$getSignList();
        }
      });
    },
    toPage(name) {
      this.$router.push({name: name})
    }
  },
  mounted() {
    this.$getUser()
    this.$getSignList();
  },
};
</script>

